.fluid_video_wrapper canvas {
    pointer-events: none;
}

.fluid_video_wrapper,
.fluid_video_wrapper * {
    -webkit-box-sizing: content-box;
    -moz-box-sizing: content-box;
    box-sizing: content-box;
}

.fluid_video_wrapper:after, .fluid_video_wrapper:before {
    content: none;
}

.fluid_video_wrapper {
    position: relative;
    display: inline-block;
}

.fluid_video_wrapper video {
    position: relative;
    background-color: #000000;
    display: block;
}

.fluid_video_wrapper .vast_video_loading {
    display: table;
    text-align: center;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    pointer-events: auto;
    z-index: 1;
}

.fluid_video_wrapper .vast_video_loading:before {
    background-image: url("+u+");
    background-position: center, center;
    background-repeat: no-repeat, repeat;
    background-color: rgba(0, 0, 0, 0.2);
    content: '';
    position: absolute;
    height: 100%;
    width: 100%;
    top: 0;
    left: 0;
}

.skip_button {
    position: absolute;
    bottom: 50px;
    right: 0;
    background-color: rgba(0, 0, 0, 0.7);
    padding: 13px 21px 13px 21px;
}

.skip_button, .skip_button a {
    color: #ffffff;
    text-decoration: none;
    cursor: pointer;
    z-index: 10;
    font-size: 13px;
    font-family: -apple-system, BlinkMacSystemFont, 'segoe ui', roboto, oxygen-sans, ubuntu, cantarell, 'helvetica neue', 'arial', sans-serif, 'apple color emoji', 'segoe ui emoji', 'segoe ui symbol';
    font-weight: normal;
    white-space: nowrap;
    text-align: start;
}

.skip_button a span.skip_button_icon {
    display: inline-block;
    text-align: left;
    width: 21px;
    position: relative;
    bottom: 20px;
}

.skip_button a span.skip_button_icon:before {
    background: url("+c+') no-repeat;
    position: absolute;
